CLANG_VERSION:
- 19.1.0.rc2
CL_VERSION:
- 19.29.30139
FINAL_CFLAGS:
- -march=nocona -mtune=haswell -ftree-vectorize -fstack-protector-strong -O2 -ffunction-sections
  -pipe
FINAL_CXXFLAGS:
- -fvisibility-inlines-hidden -std=c++17 -fmessage-length=0 -march=nocona -mtune=haswell
  -ftree-vectorize -fstack-protector-strong -O2 -ffunction-sections -pipe
RUNTIME_VERSION:
- 14.29.30139
VCVER:
- '14.2'
VSYEAR:
- '2019'
channel_sources:
- conda-forge/label/llvm_rc,conda-forge
channel_targets:
- conda-forge llvm_rc
target_platform:
- win-64
vc:
- '14'
zip_keys:
- - CLANG_VERSION
  - channel_sources
  - channel_targets
- - VCVER
  - VSYEAR
  - RUNTIME_VERSION
  - CL_VERSION
